import React from 'react'


export const ServiceContent = ({headingName,description,order,img}) => {
    return (
        <div>

            <div className='row'>

                if(order) {
                     <div className="col order-1">
                     <h2>{headingName}</h2>
                     <p>{description}</p>
                     </div>
                }
                else{
                       <div className="col order-2" >
                     <div><img src={img } alt="" /></div>
                 </div>
                }




            </div>
        </div>
    )
}
